import React from "react";
import GlobalStyle from "../../styles/Global.css";
import { useNavigate } from "react-router";

const { SideBar } = GlobalStyle

function SideBarComp() {

    const navigate = useNavigate()

    return (
        <>
            <SideBar>
                <button onClick={() => {navigate("/Account")}} style={{ backgroundColor: '#9c27b0', color: '#ffffff', marginBottom: "30px" }}><img src="https://img.icons8.com/?size=256&id=NjzqV0aREXb6&format=png" alt="" /></button>
                <button style={{ marginBottom: "auto" }} icon="pi pi-check" aria-label="Filter"><img src="https://img.icons8.com/?size=256&id=NjzqV0aREXb6&format=png" alt="" /></button>
                <button icon="pi pi-check" aria-label="Filter"></button>
            </SideBar>
        </>
    )
}

export default SideBarComp
